INSERT [dbo].[Contents] ([id], [title], [title_slug], [content_type_id], [description], [detail], [image_id], [image_list], [link_ref], [like_number], [view_number], [is_hot], [home_page], [sort], [status], [published_at], [created_at], [created_by], [updated_at], [updated_by]) VALUES (0, N'Trung tâm Ngoại ngữ - Tin học - DNTU', N'trung_tam_ngoai_ngu_dntu', 0, N'Trung Tâm Ngoại Ngữ Tin Học  - DNTU là một trong những đơn vị hàng đầu trong lĩnh vực đào tạo ngoại ngữ và tin học tại Việt Nam. Với sứ mệnh cung cấp những kiến thức và kỹ năng cần thiết để đáp ứng nhu cầu ngày càng cao của xã hội, trung tâm cam kết mang đến cho học viên những khóa học chất lượng và hiệu quả nhất.', N'<p><strong>Chất Lượng Đ&agrave;o Tạo</strong><br />
Ch&uacute;ng t&ocirc;i tự h&agrave;o về đội ngũ giảng vi&ecirc;n gi&agrave;u kinh nghiệm, c&oacute; chuy&ecirc;n m&ocirc;n s&acirc;u rộng v&agrave; tận t&acirc;m với nghề. C&aacute;c kh&oacute;a học ngoại ngữ của trung t&acirc;m bao gồm tiếng Anh, tiếng Nhật, tiếng H&agrave;n, tiếng Trung, v&agrave; nhiều ng&ocirc;n ngữ kh&aacute;c, được thiết kế ph&ugrave; hợp với mọi tr&igrave;nh độ từ cơ bản đến n&acirc;ng cao. Đặc biệt, ch&uacute;ng t&ocirc;i &aacute;p dụng phương ph&aacute;p giảng dạy hiện đại, kết hợp giữa l&yacute; thuyết v&agrave; thực h&agrave;nh, gi&uacute;p học vi&ecirc;n nhanh ch&oacute;ng nắm bắt v&agrave; sử dụng ng&ocirc;n ngữ một c&aacute;ch tự tin.<br />
Về mảng tin học, trung t&acirc;m cung cấp c&aacute;c kh&oacute;a học từ cơ bản đến chuy&ecirc;n s&acirc;u về c&aacute;c lĩnh vực như lập tr&igrave;nh, thiết kế đồ họa, quản trị mạng, v&agrave; ứng dụng văn ph&ograve;ng. Học vi&ecirc;n sẽ được tiếp cận với c&aacute;c phần mềm v&agrave; c&ocirc;ng nghệ mới nhất, đảm bảo kỹ năng học được lu&ocirc;n cập nhật v&agrave; ứng dụng hiệu quả trong c&ocirc;ng việc.</p>

<p><strong>Cơ Sở Vật Chất Hiện Đại</strong><br />
Trung t&acirc;m sở hữu hệ thống cơ sở vật chất hiện đại với c&aacute;c ph&ograve;ng học được trang bị đầy đủ thiết bị giảng dạy ti&ecirc;n tiến. M&ocirc;i trường học tập thoải m&aacute;i, th&acirc;n thiện, v&agrave; an to&agrave;n gi&uacute;p học vi&ecirc;n c&oacute; thể tập trung tối đa v&agrave;o việc học tập v&agrave; ph&aacute;t triển bản th&acirc;n.</p>

<p><strong>Đội Ngũ Gi&aacute;o Vi&ecirc;n</strong><br />
Trung T&acirc;m Ngoại Ngữ Tin Học &ndash; DNTU tự h&agrave;o sở hữu đội ngũ gi&aacute;o vi&ecirc;n l&agrave; những chuy&ecirc;n gia gi&agrave;u kinh nghiệm, c&oacute; tr&igrave;nh độ cao v&agrave; đầy nhiệt huyết. C&aacute;c gi&aacute;o vi&ecirc;n ngoại ngữ đều đ&atilde; qua đ&agrave;o tạo chuy&ecirc;n s&acirc;u, nhiều người c&oacute; bằng cấp quốc tế v&agrave; kinh nghiệm giảng dạy tại c&aacute;c trường đại học danh tiếng. Với phương ph&aacute;p giảng dạy sinh động, tương t&aacute;c cao, họ kh&ocirc;ng chỉ truyền đạt kiến thức m&agrave; c&ograve;n khơi gợi niềm đam m&ecirc; học tập, gi&uacute;p học vi&ecirc;n ph&aacute;t triển kỹ năng ng&ocirc;n ngữ một c&aacute;ch tự nhi&ecirc;n v&agrave; hiệu quả.<br />
Về mảng tin học, c&aacute;c giảng vi&ecirc;n của trung t&acirc;m đều l&agrave; những chuy&ecirc;n gia c&oacute; nhiều năm kinh nghiệm trong ng&agrave;nh c&ocirc;ng nghệ th&ocirc;ng tin, từng l&agrave;m việc tại c&aacute;c c&ocirc;ng ty c&ocirc;ng nghệ lớn trong v&agrave; ngo&agrave;i nước. Họ lu&ocirc;n cập nhật những xu hướng v&agrave; c&ocirc;ng nghệ mới nhất, từ đ&oacute; truyền tải đến học vi&ecirc;n kh&ocirc;ng chỉ kiến thức l&yacute; thuyết m&agrave; c&ograve;n những kỹ năng thực tiễn quan trọng, gi&uacute;p học vi&ecirc;n sẵn s&agrave;ng cho m&ocirc;i trường l&agrave;m việc hiện đại.</p>

<p><strong>Cam Kết Học Vi&ecirc;n</strong><br />
Ch&uacute;ng t&ocirc;i hiểu rằng mỗi học vi&ecirc;n c&oacute; những nhu cầu v&agrave; mục ti&ecirc;u học tập ri&ecirc;ng. Do đ&oacute;, trung t&acirc;m lu&ocirc;n nỗ lực để mang đến c&aacute;c giải ph&aacute;p đ&agrave;o tạo linh hoạt, đ&aacute;p ứng được mọi y&ecirc;u cầu của học vi&ecirc;n. B&ecirc;n cạnh đ&oacute;, trung t&acirc;m c&ograve;n cung cấp c&aacute;c dịch vụ tư vấn v&agrave; hỗ trợ học vi&ecirc;n trong suốt qu&aacute; tr&igrave;nh học tập, đảm bảo rằng mỗi học vi&ecirc;n đều đạt được mục ti&ecirc;u của m&igrave;nh sau khi ho&agrave;n th&agrave;nh kh&oacute;a học.</p>

<p><strong>H&atilde;y Đến Với Ch&uacute;ng T&ocirc;i</strong><br />
Nếu bạn đang t&igrave;m kiếm một nơi để n&acirc;ng cao tr&igrave;nh độ ngoại ngữ hoặc tin học của m&igrave;nh, Trung T&acirc;m Ngoại Ngữ Tin Học - DNTU ch&iacute;nh l&agrave; lựa chọn ho&agrave;n hảo. H&atilde;y đến v&agrave; trải nghiệm những kh&oacute;a học chất lượng, dịch vụ tận t&igrave;nh v&agrave; cơ hội ph&aacute;t triển bản th&acirc;n vượt bậc tại trung t&acirc;m ch&uacute;ng t&ocirc;i.</p>
